import React from 'react';
import { NavLink, Link, withRouter, useHistory } from 'react-router-dom';
import { isAuthenticated, logout  } from './../../help/auth';
import './style.css';


function Header ({ currentCompany }) {
    let history = useHistory();

    console.log(isAuthenticated());

    return (
        <header className="header">
            <Link exact to="/">
            <div className="logo_container">
                <strong className="logo">LogisTech</strong>
            </div>
            </Link>


            <div className="header_direita">
                <Link exact to="/login">
                <div className="login">
                    <span>Log in</span>
                </div>
                </Link>

                <Link>
                <div className="contato">
                    <span>Contact</span>
                </div>
                </Link>

                <Link exact to="/register">
                <div className="cadastro_empresa">
                    <span>Register</span>
                </div>
                </Link>

                {isAuthenticated() && (
                    <div>
                        <Link exact to="/logout" 
                        onClick={()=> Signout(()=> history.push('/'))}>
                            <div className="contato">
                                <span>Log out</span>
                            </div>
                        </Link>

                    </div>
                )}

            </div>
        </header>
    );
}

export default Header;
